 const SubStr= require('./substring');

function Collt(st1,datas){
var result=datas[1];
var t = 0;
while(t<datas.length){
    if(!SubStr("h",datas[t].name)){
      result=SubStr(st1,datas[1].name);

     result.concat(datas[t]);
      

    // }t++;
    t++;
}

return result;
}

}
module.exports.Collt = Collt;
